def get_last_five_digits_of_factorial(n: int) -> str:

    def factorial(number: int) -> int:
        ans = 1
        for i in range(1, number + 1):
            ans *= i
        return ans
    if n > 25:
        return '00000'
    fact_value = factorial(n)
    last_five_digits = fact_value % 100000
    return f'{last_five_digits:05}'

